import React from 'react';
import './Header.css';

function Header () {

	var reak = "{ REACT }";
	
	const test = () => {
		console.log( `funciono!` );
		var mensaje = promp( "algo" );
	};
	
	return (
		<header>
			<h1 onClick={test}>PRACTICE - {reak}</h1>
		</header>
	);
}

export default Header;
